$(function(){"use strict";$("#fileupload").fileupload({maxFileSize:1e7,acceptFileTypes:/(\.|\/)(gif|jpe?g|png|pdf|doc|docx)$/i});$("#fileupload").fileupload("option","redirect",window.location.href.replace(/\/[^\/]*$/,"/cors/result.html?%s"));$("#fileupload").each(function(){var that=this;$.getJSON(this.action,function(result){if(result&&result.length){$(that).fileupload("option","done").call(that,null,{result:result})}})})});